import React from 'react';
import Grid from '@material-ui/core/Grid';
import styles from '../../css/Home.module.css';

export const Footer = () => {
    return(
        <React.Fragment>

            <Grid container spacing={1}>
                <Grid item xs={7}>
                    <div>
                        111
                    </div>
                </Grid>
                <Grid item xs={5}>
                    <div>
                        222
                    </div>
                </Grid>
            </Grid>

        </React.Fragment>
    )
}
